import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="bg-gray-800 py-3 px-5 flex justify-between">
      <h1 className="text-primary font-bold text-xl">Smart Expense</h1>
      <div className="flex space-x-4">
        <Link to="/" className="hover:text-primary">Dashboard</Link>
        <Link to="/add" className="hover:text-primary">Add</Link>
        <Link to="/budget" className="hover:text-primary">Budget</Link>
        <Link to="/reports" className="hover:text-primary">Reports</Link>
      </div>
    </nav>
  );
}

export default Navbar;
